how to do two groupBy query in single aggregation based on the lookup<p>I have two collections and I need to group documents from both using a single query using <code>$lookup</code> and <code>$group</code>.
Here is my db data and the expected output:</p>
<p><strong>currentBills table</strong></p>
<pre><code>const currentBills = [
  {
    memberId: 1,
    name: 'Mark',
    status: 'paid'
  },
  {
    memberId: 2,
    name: 'Steve',
    status: 'unpaid'
  },
  {
    memberId: 3,
    name: 'William',
    status: 'paid'
  }
];
</code></pre>
<p><strong>pastBills table</strong></p>
<pre><code>const pastBills = [
  {
    memberId: 5,
    name: 'Joe',
    status: 'paid'
  },
  {
    memberId: 8,
    name: 'Carlos',
    status: 'paid'
  },
  {
    memberId: 25,
    name: 'ben',
    status: 'unpaid'
  }
];
</code></pre>
<p><strong>expected output</strong></p>
<pre><code>
const result = {
  CurrentBill: {
    paid: [
      {
        memberId: 1,
        name: 'Mark',
        status: 'paid'
      },

      {
        memberId: 3,
        name: 'William',
        status: 'paid'
      }
    ],
    unpaid: [
      {
        memberId: 2,
        name: 'Steve',
        status: 'unpaid'
      }
    ]
  },
  pastBill: {
    paid: [
      {
        memberId: 5,
        name: 'Joe',
        status: 'paid'
      },
      {
        memberId: 8,
        name: 'Carlos',
        status: 'paid'
      }
    ],
    unpaid: [
      {
        memberId: 25,
        name: 'ben',
        status: 'unpaid'
      }
    ]
  }
};

</code></pre>
<p><strong>my query</strong></p>
<pre><code>db.getCollection('currentBills').aggregate([
{
   $lookup:
     {
       from: &quot;pastBills&quot;,
       localField: &quot;memberId&quot;,
       foreignField: &quot;memberId&quot;,
       as: &quot;bill&quot;
     }
},{
    $unwind : &quot;$bill&quot;
    },
    {
        $group : {
            _id : &quot;$status&quot;
            }
        }
        ])
</code></pre>
<p>How to group each collections by the <code>status</code> and return a single result? Is this possible using a single aggregation query?</p>
<p>Thanks in advance!</p>

