<pre><code>http://localhost:3000/api/user?page=&amp;status=&amp;search&amp;role_id=
</code></pre>
<p>So when the <strong>status</strong> is available, the <strong>where clause related to it should work</strong>, the <strong>same for search and role_id</strong>.</p>
<p>I have tried to built a query where pagination part along with search parameter is working perfectly. But when I pass/set the keys of
query string, the query shows no results.</p>
<p>The query I have build so far is something like this:-</p>
<pre><code>let {page, search, status, role_id} = req.query;
role_id = role_id ? role_id : null;
status = status ? status : null;
const currentPage = parseInt(page) || 1;
const perPage = recordsPerPage;
const userData = await User.find({
                                $and: [
                                    {
                                        $or : [
                                                {username:{'$regex' : search, '$options' : 'i'}},
                                                {email:{'$regex' : search, '$options' : 'i'}}
                                            ]
                                    },
                                    {
                                        $or : [
                                            {status : status}
                                        ]
                                    },
                                    {
                                            $or : [
                                                {role_id : role_id}
                                            ]
                                    },
                                    {
                                        email: { $ne: 'xxxxx@gmail.com' }
                                    }
                                ]
                            })
                            .sort({_id : -1})
                            .populate('role_id')
                            .skip((currentPage - 1) * perPage).limit(perPage);
</code></pre>

